import Gangnam from "../../public/gangnam-style.svg"

const Index = () => {
    return (
        <div style={{textAlign: "center", fontWeight: "bold", marginTop: "20px", maxHeight: "100vh"}}>
            Welcome to Next Image Project
            <img src={Gangnam} />
        </div>
    )
}

export default Index;
